function init(){for(var e=document.getElementsByTagName("img"),t=0;t<e.length;t++)if(e[t].getAttribute("data-src")){e[t].setAttribute("src",e[t].getAttribute("data-src"));e[t].getAttribute("data-src")}}function slideshow(){setInterval(function(){nextSlide("mi-ss")},2e3)}function nextSlide(e){var t=document.getElementById(e).getElementsByClassName("slide");t.index=t.index||0,t[t.index].className="slide",t.index=(t.index+1)%t.length,t[t.index].className="slide showing"}init(),onload=slideshow;